import React from "react";

function App() {
    return (
        <div>
            <Navbar />
            <section id="home">
                <Home />
            </section>
            <section id="about">
                <About />
            </section>
            <section id="companyList">
                <CompanyList />
            </section>
            <section id="sampleGraph">
                <SampleGraph />
            </section>
            <Footer />
        </div>
    );
}

export default App;
